import resolve from "@rollup/plugin-node-resolve";
import commonjs from "@rollup/plugin-commonjs";
import babel from "@rollup/plugin-babel";
import cleanup from "rollup-plugin-cleanup";

const extensions = [".ts"];

function ON_WARN(warning, rollupWarn) {
	if (warning.code === "CIRCULAR_DEPENDENCY") {
		warning.cycle.forEach((c) => {
			if (c.endsWith("index.ts")) {
				throw new Error(warning.message);
			}
		});
		console.log(warning.message);
	}
}

// package list is stored in package.json
const packages = require("./package.json").packages;
// as are names for the packages.
const packageNames = require("./package.json").packageNames;

const out = [];
packages.filter((p) => {
	const name = packageNames[`@jsplumb/${p}`];
	if (name == null) {
		throw `No package name found in package.json for package ${p}. Add a mapping in the "packageNames" map for this package.`;
	}
	out.push({
		input: `./ts/${p}/index.ts`,
		// every package except the current one is considered external.
		external: (moduleId) =>
			moduleId.indexOf("@jsplumb") === 0 && moduleId !== `@jsplumb/${p}`,
		output: [
			{
				name: name,
				file: `dist/${p}/js/jsplumb.${p}.cjs.js`,
				format: "cjs"
			},
			{
				name: name,
				file: `dist/${p}/js/jsplumb.${p}.es.js`,
				format: "es"
			},
			{
				name: name,
				file: `dist/${p}/js/jsplumb.${p}.umd.js`,
				format: "umd",
				globals: packageNames
			}
		],
		plugins: [
			resolve({ extensions }),
			commonjs(),
			babel({ extensions, include: [`ts/${p}/**/*`], babelHelpers: "bundled" }),
			cleanup({ extensions: ["ts", "js"] })
		],
		onwarn: ON_WARN
	});
});

export default out;

module.exports = function (api) {
	api.cache(true);

	const presets = [
		[
			"@babel/env",
			{
				modules: false
			}
		],
		"@babel/preset-typescript"
	];
	const plugins = [
		"@babel/proposal-class-properties",
		"@babel/proposal-object-rest-spread"
	];

	return {
		presets,
		plugins
	};
};

/**
 * This runs as a preinstall. It recurses through the directories in the project and runs `npm install` anywhere it finds
 * a `package.json` (it skips `node_modules` directories)
 */

("use strict");

const path = require("path");
const fs = require("fs");
const child_process = require("child_process");

const root = process.cwd();
npm_install_recursive(root);
grunt_build_recursive(root);

// Since this script is intended to be run as a "preinstall" command,
// it will be `npm install` inside root in the end.
console.log(
	"==================================================================="
);
console.log(`Performing "npm install" inside root folder`);
console.log(
	"==================================================================="
);

function npm_install_recursive(folder) {
	const has_package_json = fs.existsSync(path.join(folder, "package.json"));

	// Since this script is intended to be run as a "preinstall" command,
	// skip the root folder, because it will be `npm install`ed in the end.
	if (folder !== root && has_package_json) {
		console.log(
			"==================================================================="
		);
		console.log(
			`Performing "npm install" inside ${
				folder === root ? "root folder" : "./" + path.relative(root, folder)
			}`
		);
		console.log(
			"==================================================================="
		);

		npm_install(folder);
	}

	for (let subfolder of subfolders(folder)) {
		npm_install_recursive(subfolder);
	}
}

function npm_install(where) {
	child_process.execSync("npm install", {
		cwd: where,
		env: process.env,
		stdio: "inherit"
	});
}

function subfolders(folder) {
	return fs
		.readdirSync(folder)
		.filter((subfolder) =>
			fs.statSync(path.join(folder, subfolder)).isDirectory()
		)
		.filter((subfolder) => subfolder !== "node_modules" && subfolder[0] !== ".")
		.map((subfolder) => path.join(folder, subfolder));
}

function grunt_build_recursive(folder) {
	const has_gruntfile = fs.existsSync(path.join(folder, "Gruntfile.js"));

	// Since this script is intended to be run as a "preinstall" command,
	// skip the root folder, because it will be `npm install`ed in the end.
	if (folder !== root && has_gruntfile) {
		console.log(
			"==================================================================="
		);
		console.log(
			`Performing "grunt build" inside ${
				folder === root ? "root folder" : "./" + path.relative(root, folder)
			}`
		);
		console.log(
			"==================================================================="
		);

		grunt_build(folder);
	}

	for (let subfolder of subfolders(folder)) {
		grunt_build_recursive(subfolder);
	}
}

function grunt_build(where) {
	child_process.execSync("grunt build", {
		cwd: where,
		env: process.env,
		stdio: "inherit"
	});
}

