// modal框
$.rails.allowAction = function (link) {
  if (!link.is('[data-confirm]')) {
    return true;
  }
  // change namespace of dialog to define custom global `css` class name
  BootstrapDialog.NAMESPACE = 'git-modal';
  BootstrapDialog.show({
    type: BootstrapDialog.TYPE_DANGER,
    title: i18n.t('projects.applications.dialogTitle'),
    message: link.attr('data-confirm'),
    buttons: [
      {
        label: i18n.t('projects.applications.dialogButtonOk'),
        action(dialogRef) {
          link.removeAttr('data-confirm');
          link.trigger('click.rails');
          dialogRef.close();
        },
      },
      {
        label: i18n.t('projects.applications.dialogButtonCancel'),
        action(dialogRef) {
          dialogRef.close();
        },
      },
    ],
  });
  return false;
};

document.addEventListener('beforeunload', () => {
  // Unbind scroll events
  $(document).off('scroll');
  // 移除记录review耗时的绑定
  $(document).off('mousemove');
  // Close any open tooltips
  $('.has-tooltip, [data-toggle="tooltip"]').tooltip('dispose');
  // Close any open popover
  $('[data-toggle="popover"]').popover('dispose');
});

/**
 * 前进后退行为也会触发hashchange, 只滚动, 不进行对history栈的操作
 */
$(window).on('hashchange', function (event) {
  const { originalEvent } = event;
  const href = originalEvent.newURL ? originalEvent.newURL : location.href;
  const [url, hash] = href.split('#');
  if (url === getLocationUrl()) {
    event.preventDefault();
    defaultScroll(hash);
  }
});

window.addEventListener(
  'load',
  function onLoad() {
    window.removeEventListener('load', onLoad, false);
    if (gon.features.access_log_enable) {
      import('~/analytics' /* webpackChunkName: "analytics" */).then(({ default: Analytics }) => {
        new Analytics();
      });
    }
    NProgress.done(gon.page_version !== 'tm');
    // handleLocationHash();
    if (location.hash) {
      if (isDelayedScroll()) {
        // 异步滚动对应页面上自行处理
        return;
      }
      // 直接滚动
      // 设置定时器的目的是保证“在浏览器完成滚动到上一次打开的位置”这一行为执行之后再滚动
      return setTimeout(function () {
        defaultScroll(location.hash.substring(1));
      }, 1);
    }
  },
  false,
);

const nprogressDisabledProtocols = ['mailto:'];

window.addEventListener(
  'beforeunload',
  function beforeUnload() {
    // 通过activeElement间接判断触发unload事件的元素
    // 但这种方法也存在问题：
    // 当指定的需要屏蔽nprogress的元素获取了焦点时，用户触发了浏览器刷新或者其他能触发unload事件的操作，nprogress同样不会被触发
    // ==========
    // 通过手动调用activeElement.blur()，可以规避部分上述问题
    const { activeElement } = document;
    if (
      activeElement.getAttribute('data-nprogress-disabled') ||
      (activeElement.tagName === 'A' && nprogressDisabledProtocols.indexOf(activeElement.protocol) !== -1)
    ) {
      activeElement.blur();
      return;
    }
    // 在编辑文件的时候触发beforeunload事件，如果用户手动点击了取消
    // 因无法得知用户在弹框的操作，导致无法暂停读条
    // 所以引入nprogress-disabled属性，当值为true时，不读条
    if (!$(document.body).data('nprogress-disabled')) {
      NProgress.start();
    }
  },
  false,
);

document.addEventListener('DOMContentLoaded', () => {
  /**
   * QQ浏览器自带的loader.js在文档解析时会将html根结点style.display设置为none
   * 在load事件才将style.display属性移除
   * 导致在DOMContentLoaded事件中计算元素位置和判断元素显隐的逻辑失效，如jquery-ui
   */
  fixQQBrowser();
  bindEvent();
  if (gon.page_version !== 'tm') {
    NProgress.start();
    new Sidebar();
  }
  if (gon.features.theme_change) {
    import('~/theme' /* webpackChunkName: "theme" */).then(({ default: Theme }) => new Theme());
  }
  const $body = $('body');
  renderExtendedMarkdown($body);
  flexibleTable('.file-holder .file-content.wiki', { waitForMarkdownRender: true });
  flexibleTable('.notes_content', { waitForMarkdownRender: true });
  Select2Module.init();
  requestIdleCallback(deferredInitialization, { timeout: 2000 });
});

function deferredInitialization() {
  const $body = $('body');
  if (gon.page_version !== 'tm') {
    initTopBarSearch();
    new SearchInput('.main-search #search', true);
  }
  new InteractiveTooltip('.has_tooltipster');
  // init broadcast tips
  broadcastTipsInit('.broadcast-msg');
  $(document).ajaxSend((e, xhr) => {
    const header = $('meta[name="csrf-header"]').attr('content');
    const token = $('meta[name="csrf-token"]').attr('content');
    xhr.setRequestHeader(header, token);
  });

  $body.tooltip({
    selector: '.has_tooltip, [data-toggle="tooltip"], .page-sidebar-collapsed .nav-sidebar a:not(.menu-ele-link)',

    placement(_, el) {
      const $el = $(el);
      if ($el.attr('id') === 'js-shortcuts-home') {
        return $el.parents('header').hasClass('header-collapsed') ? 'right' : 'bottom';
      }
      return $el.data('placement') || 'bottom';
    },
  });

  $('abbr.timeago, .js-timeago').timeago();

  $('[data-toggle="popover2"]').each(function () {
    const element = $(this);
    element.popover().on('hide.bs.popover', () => {
      // hide tooltips
      $('.tooltip[role="tooltip"]').remove();
    });
  });

  $(document).on('submit', 'form[data-nprogress-disabled="true"]', () => {
    // beforeunload事件在submit后触发
    setTimeout(() => {
      NProgress.done();
    }, 100);
  });
}

// 统一事件绑定
function bindEvent() {
  new HeaderApp();

  $(document).on('focusin', '.js-select-on-focus', function () {
    return $(this)
      .select()
      .one('mouseup', (e) => e.preventDefault());
  });
  $(document).on('ajax:success', '.remove-row', function (e, error, status, xhr) {
    if (xhr.getResponseHeader('user-initialized') && !JSON.parse(xhr.getResponseHeader('user-initialized'))) {
      window.location.href = xhr.getResponseHeader('redirect-url');
    } else {
      $(this).closest('li').fadeOut();
    }
  });

  $(document).on('ajax:error', 'form:not(.flash-disabled)', (event, xhr) => {
    const errorMessage = xhr?.responseJSON?.message || i18n.t('common.formServerError');
    new Flash(errorMessage, 'danger');
  });

  $(document).on('ajax:error', '.remove-row', (e, xhr) => {
    const errorMessage = xhr.getResponseHeader('message');
    if (errorMessage && typeof errorMessage !== 'undefined') {
      new Flash(decodeURIComponent(errorMessage), 'danger');
    } else {
      new Flash(i18n.t('common.removeRowErrorTips'), 'danger');
    }
  });

  $(document).on('ajax:before', '.js-remove-tr', function () {
    $(this).hide();
  });
  $(document).on('ajax:success', '.js-remove-tr', function () {
    $(this).closest('tr').fadeOut();
  });

  $(document).on('click', () => {
    // 只有当popover为打开状态时才触发hide事件
    if ($('.profile-info .popover').length) {
      $('.profile-info').popover('hide');
    }
  });

  // profile info jsp 页面布局场景下的事件绑定
  if (gon.page_version !== 'tm') {
    const $profileInfo = $('.profile-info');
    const $gitPopover = $('.git-popover');
    $profileInfo.on('show.bs.popover', () => {
      initUserStats();
    });
    $($profileInfo.data('container')).on('click', (e) => {
      // 排除 sign-out ，经过rails.js 进行事件代理(sign-out 是 post 请求）
      if (e.target && !$(e.target).hasClass('sign-out')) {
        e.stopPropagation();
      }
    });
    $profileInfo.on('click', (e) => {
      if ($gitPopover.hasClass('open')) {
        $gitPopover.filter('.open').popover('hide');
      }
      // 排除 sign-out ，经过rails.js 进行事件代理
      if (e.target && !$(e.target).hasClass('sign-out')) {
        e.stopPropagation();
      }
      $('.app-content').popover('hide');
    });
  }
  // avatar upload
  $(document).on('click', '.js-choose-avatar-button', function () {
    const form = $(this).closest('form');
    return form.find('.js-avatar-input').click();
  });
  // todo 带验证
  $(document).on('change', '.js-avatar-input', function () {
    const form = $(this).closest('form');
    const fileName = $(this)
      .val()
      .replace(/^.*[\\/]/, '');
    return form.find('.js-avatar-filename').text(fileName);
  });

  $(document).on('blur focusout', '.has-popover', function () {
    $(this).popover('hide');
  });
  $(document).on('change', '.trigger-submit', function (event) {
    // 防止误触发change事件
    if (event.target.classList.contains('select2-focusser')) {
      return;
    }
    $(this).parents('form').submit();
  });

  // form submit后会自动disable掉提交按钮，可以为form标签增加 js-submit-btn-enable 类屏蔽该特性
  $(document).on('ajax:complete ajax:beforeSend submit', 'form:not(.js-submit-btn-enable)', function (e) {
    const buttons = $('[type="submit"]', this);
    switch (e.type) {
      case 'ajax:beforeSend':
      case 'submit':
        return buttons.disable();
      default:
        return buttons.enable();
    }
  });

  $(document).on('click', '.js-toggle-button', function (e) {
    const $this = $(this);
    const $container = $this.closest('.js-toggle-container');

    $(this).find('.caret').toggleClass('up');
    $(this).closest('.js-toggle-container').toggleClass('toggled');
    $(this).closest('.js-toggle-container').find('.js-toggle-content').toggle();

    if (!$container.hasClass('toggled')) {
      const detailText = $this.data('detail-text');
      detailText ? $container.find('.js-toggle-text').text(detailText) : '';
    } else {
      const toggleText = $this.data('collapse-text');
      toggleText ? $container.find('.js-toggle-text').text(toggleText) : '';
    }

    return e.preventDefault();
  });

  $(document).on('click', '.js-toggle-button-close', function (e) {
    $(this)
      .closest('.js-toggle-container')
      .find('.js-toggle-content')
      .toggle()
      .removeClass('in collapse')
      .removeAttr('style');
    return e.preventDefault();
  });

  // todo 待优化
  /**
   * 当前页面锚点跳转处理
   */
  $(document).on('click', 'a[href*="#"]', function (event) {
    const [{ href }] = $(this);
    const [url, hash] = href.split('#');
    if (url === getLocationUrl()) {
      event.preventDefault();
      if (defaultScroll(hash)) {
        // 只有成功跳转或不在文件展示页面才增加历史记录
        history.pushState({}, document.title, href);
      }
    }
  });
}
 
import values from 'lodash/values';
import debounce from 'lodash-decorators/debounce';
import bind from 'lodash-decorators/bind';
import { lt } from './utils/media_query';
import { resizeSidebarTooltips } from '~/layout/sidebar/item/sidebar_tooltips';

export default class Sidebar {
  constructor() {
    this.initElement();
    this.bindEvent();
    this.renderTooltips();
  }

  initElement() {
    this.$pageSidebar = $('.page-with-sidebar');
    this.$header = $('header');
    this.$sidebarItem = $('.nav-sidebar li a:not(".menu-ele-link")', this.$pageSidebar);
    this.pageSidebarClass = {
      collapsed: 'page-sidebar-collapsed',
      expanded: 'page-sidebar-expanded',
    };
    this.headerClass = {
      collapsed: 'header-collapsed',
      expanded: 'header-expanded',
    };
    this.tooltipClass = 'has_tooltip';
  }

  bindEvent() {
    $(document).on('click', '.toggle-nav-collapse', this.toggleSidebar);
    $(window).on('resize', this.renderTooltips);
  }

  /*
       1. 对于class为 collapsed 的侧边栏，添加tooltips显示
       2. 特殊情况: 如果缩小窗口的时候，窗口缩小至 md sm xs 的时候，无论侧边栏的class为 collapese or expanded，侧边栏都被收缩
       3.  进入页面，如果侧边栏读取cookie，当前页面处于collapse，那么会被 tooltips选中，进行tooltips显示
                   窗口尺寸 < lg
                   窗口尺寸 > lg
           如果侧边栏读取 cookie，当前页面处理 expanded
                   窗口尺寸 < lg ，侧边栏收缩，进行tooltips显示
                   窗口尺寸 > lg ，侧边栏不进行tooltips显示
       4.  收缩窗口
               侧边栏处于 collapse ，那么会被tooltips选中，进行tooltips显示
               侧边栏处于 expanded
                   窗口尺寸 < lg ，侧边栏收缩，进行tooltips显示
                   窗口尺寸 > lg ，侧边栏不进行tooltips显示
    */
  @debounce(300)
  @bind()
  renderTooltips() {
    if (this.$pageSidebar && this.$pageSidebar.hasClass(this.pageSidebarClass.expanded)) {
      resizeSidebarTooltips(this.$sidebarItem);
    }
  }

  toggleSidebar = (e) => {
    e.preventDefault();
    // >= lg
    if (!lt('lg')) {
      this.$pageSidebar.toggleClass(values(this.pageSidebarClass).join(' '));
      this.$header.toggleClass(values(this.headerClass).join(' '));
      this.setSidebarToggleCookie('collapsed_nav');
    }
  };

  setSidebarToggleCookie(cookieName) {
    $.cookie(cookieName, this.$pageSidebar.hasClass(this.pageSidebarClass.collapsed), {
      path: '/',
    });
  }
}
 
import { postConstruct } from '@tencent/decorators-tgit';
import beacon from '~/commons/datahub';
import Tracker from '~/commons/tracker';
import { encodeSaferUrl } from '~/utils/url_utility';

@postConstruct
class Analytics {
  setUp() {
    this.common = {
      un: gon.current_username && encodeURIComponent(gon.current_username),
      s: gon.analytics.session_id && encodeURIComponent(gon.analytics.session_id),
      rf: gon.analytics.referer && encodeURIComponent(gon.analytics.referer),
    };
    this.accessLogs();
    this.access_log_url = `${gon.analytics.access_log_url}assets/js/tpl.js/`;
    /**
     * set up request data
     */
    this.appendScript([this.access_log_url]);
    this.reportDatahubPageLoad();
    this.setPageTracker();
  }

  appendScript(srcArray) {
    if (!srcArray || !(srcArray instanceof Array) || srcArray.length <= 0) {
      return;
    }
    const docFrag = document.createDocumentFragment();
    for (let i = 0; i < srcArray.length; i++) {
      if (!srcArray[i]) {
        continue;
      }
      const script = document.createElement('script');
      script.type = 'text/javascript';
      script.src = srcArray[i];
      docFrag.appendChild(script);
    }
    document.body.appendChild(docFrag);
  }

  accessLogs() {
    window.url_bk_log_args = {
      bp: gon.analytics.access_log_url && encodeSaferUrl(gon.analytics.access_log_url),
      pi: gon.analytics.project_id && encodeURIComponent(gon.analytics.project_id),
      gi: gon.analytics.group_id && encodeURIComponent(gon.analytics.group_id),
    };
    Object.assign(window.url_bk_log_args, this.common);
  }

  reportDatahubPageLoad() {
    if (beacon) {
      const pageName = document.body.getAttribute('data-page');
      beacon.onDirectUserAction('show_page', {
        group_id: gon.analytics.group_id && encodeURIComponent(gon.analytics.group_id),
        project_id: gon.analytics.project_id && encodeURIComponent(gon.analytics.project_id),
        username: gon.current_username && encodeURIComponent(gon.current_username),
        page_name: pageName,
        project_path: gon.analytics.project_path,
        group_full_path: gon.analytics.group_full_path,
        project_create_at: gon.analytics.project_create_at,
        project_visiblity_level: gon.analytics.project_visiblity_level,
        project_creator_id: gon.analytics.project_creator_id,
        full_path: window.location.href,
        referrer: document.referrer,
      });
    }
  }

  setPageTracker() {
    new Tracker();
  }
}

export default Analytics;
 
import Flash from '~/commons/flash';

function bindUnionTapd() {
  $(document).off('ajax:before', 'form.js-issue-union-form');
  $(document).on('ajax:before', 'form.js-issue-union-form', function () {
    const tapdProject = $(this).find('select.tapd-project').val();
    const tapdTicketId = $("input[name='tapd_id']:checked").val();
    if (!tapdProject) {
      $.toast({ text: i18n.t('tapds.projectRequired'), type: 'error', position: 'top-right' });
      setTimeout(function () {
        $('.js-tapd-union-btn').enable();
      }, 500);
      return false;
    }
    if (!tapdTicketId) {
      $.toast({ text: i18n.t('tapds.ticketRequired'), type: 'error', position: 'top-right' });
      setTimeout(function () {
        $('.js-tapd-union-btn').enable();
      }, 500);
      return false;
    }
    if ($(`#tapd_${String(tapdTicketId)}`).length > 0) {
      // 提交前校验TAPD单是否已绑定，已绑定则拦截请求
      Flash.danger(i18n.t('tapds.linkTwiceError'));
      setTimeout(function () {
        $('.js-tapd-union-btn').enable();
      }, 500);
      return false;
    }
  });

  $(document).off('ajax:success', 'form.js-issue-union-form');
  $(document).on('ajax:success', 'form.js-issue-union-form', function (xhr, data) {
    if (data.success) {
      $('.issuable-sidebar-control.tapd ul.content-list .issuable-context-none').remove();
      $('.issuable-sidebar-control.tapd ul.content-list').append(data.html);
      setTimeout(() => {
        $('.issuable-sidebar-control.tapd ul.content-list li:last-child').effect('highlight');
        Flash.success(i18n.t('tapds.linkSuccess'));
      }, 300);
    } else {
      Flash.danger(i18n.t('tapds.linkError'));
    }
    $('.js-tapd-union').popover('hide');
  });
  $(document).off('ajax:error', 'form.js-issue-union-form');
  $(document).on('ajax:error', 'form.js-issue-union-form', function () {
    $.toast({ text: i18n.t('common.serverError'), type: 'error', position: 'top-right' });
    $('.js-tapd-union').popover('hide');
  });
}

function bindCreateTapd() {
  $(document).off('submit', 'form.js-issue-to-tapd-form');
  $(document).on('submit', 'form.js-issue-to-tapd-form', function () {
    const tapdProject = $(this).find('select.tapd-project').val();
    const tapdType = $(this).find('select.tapd_type').val();
    const gitIid = $(this).find("input[name='git_iid']").val();
    const gitType = $(this).find("input[name='git_type']").val();
    const url = $(this).attr('action');
    $.ajax({
      type: 'POST',
      url,
      data: {
        tapd_project_id: tapdProject,
        tapd_type: tapdType,
        git_iid: gitIid,
        git_type: gitType,
      },
      success(data) {
        if (data.success) {
          $('.issuable-sidebar-control.tapd ul.content-list .issuable-context-none').remove();
          $('.issuable-sidebar-control.tapd ul.content-list').append(data.html);
          setTimeout(function () {
            $('.issuable-sidebar-control.tapd ul.content-list li:last-child').effect('highlight');
            Flash.success(i18n.t('tapds.createAndLinkSuccess'));
          }, 300);
        } else {
          $.toast({ text: i18n.t('common.serverError'), type: 'error', position: 'top-right' });
        }
        $('.js-tapd-create').popover('hide');
      },
      error() {
        $.toast({ text: i18n.t('common.serverError'), type: 'error', position: 'top-right' });
        $('.js-tapd-create').popover('hide');
      },
      dataType: 'json',
    });
    return false;
  });
}

function bindUnlinkTapd() {
  $(document).off('click', 'a.js-unlink-tapd-btn');
  $(document).on('click', 'a.js-unlink-tapd-btn', function () {
    const $this = $(this);
    const unlinkParams = {
      // git_iid: $this.data('git-iid'),
      // git_type: $this.data('git-type'),
      tapd_id: $this.data('tapd-id'),
      tapd_project_id: $this.data('tapd-project-id'),
      tapd_type: $this.data('tapd-type'),
    };
    const $form = $('form.js-tapd-unlink-form');
    Object.keys(unlinkParams).forEach((paramName) => {
      $form.find(`[name=${paramName}]`).val(unlinkParams[paramName]);
    });
  });

  $(document).off('ajax:beforeSend', 'form.js-tapd-unlink-form');
  $(document).on('ajax:beforeSend', 'form.js-tapd-unlink-form', function () {
    $('.js-confirm-unlink-submit').disable();
  });
  $(document).off('ajax:complete', 'form.js-tapd-unlink-form');
  $(document).on('ajax:complete', 'form.js-tapd-unlink-form', function (e, ajax) {
    const data = ajax.responseJSON;
    if (data.success) {
      const tapdId = $(this).find('[name="tapd_id"]').val();
      const $sidebarTapdList = $('.issuable-sidebar-control.tapd ul.content-list');
      $sidebarTapdList.find(`#tapd_${tapdId}`).remove();
      $sidebarTapdList.parents('.tapd').effect('highlight');
      Flash.success(data.message);
      if ($sidebarTapdList.children().length < 1) {
        window.location.reload();
      }
    } else {
      Flash.danger(data.message);
    }
    $('.js-confirm-unlink-submit').enable();
    $('#unlink-tapd-modal').modal('toggle');
  });
}

function bindFilter() {
  $(document).on('click', '.js-tapd-filter', function () {
    const tapdProjectId = $('select.js-tapd-select2').val();
    if (!tapdProjectId) {
      $.toast({ text: i18n.t('tapds.selectProject'), type: 'error', position: 'top-right' });
    }
    const tapdType = $('select.js-tapd-type-select2').val();
    const title = $('#tapd-title').val();
    const owner = $('#tapd-owner').val();
    const url = '/tapd_apiv2/list';
    const params = {
      workspaceId: tapdProjectId,
      type: tapdType,
      title,
      handler: owner,
      page: 1,
    };
    $('.tapd-ticket-wrapper').show();
    $.get(url, params, function (response) {
      if (response.success) {
        $('.js-tapd-tickets').empty().append(response.html);
      }
      $('.tapd-ticket-wrapper').hide();
    });
  });

  $(document).on('click', '.js-tapd-filter-page', function () {
    const url = $(this).data('url');
    if (!url) {
      return;
    }
    $('.tapd-ticket-wrapper').show();
    $.get(url, function (response) {
      if (response.success) {
        $('.js-tapd-tickets').empty().append(response.html);
      }
      $('.tapd-ticket-wrapper').hide();
    });
  });
}

export default function tapd() {
  $('.js-tapd-create, .js-tapd-union').on('shown.bs.popover', function () {
    $.extend($.fn.select2.defaults, $.fn.select2.locales[window.gon.user_locale]);
    $('select.select2.js-tapd-select2, select.select2.js-tapd-type-select2').select2({
      width: 'resolve',
      dropdownAutoWidth: true,
      formatSelectionCssClass(data, container) {
        // data表示选择的value值
        if (data && data.id !== undefined) {
          container.addClass('active');
        } else {
          container.removeClass('active');
        }
      },
    });
  });
  bindCreateTapd();
  bindUnlinkTapd();
  bindUnionTapd();
  bindFilter();
}
 
