if (typeof Object.assign != 'function') {
  // Must be writable: true, enumerable: false, configurable: true
  Object.defineProperty(Object, 'assign', {
    value: function assign(target, varArgs) {
      // .length of function is 2
      'use strict';
      if (target == null) {
        // TypeError if undefined or null
        throw new TypeError('Cannot convert undefined or null to object');
      }
      var to = Object(target);
      for (var index = 1; index < arguments.length; index++) {
        var nextSource = arguments[index];
        if (nextSource != null) {
          // Skip over if undefined or null
          for (let nextKey in nextSource) {
            // Avoid bugs when hasOwnProperty is shadowed
            if (Object.prototype.hasOwnProperty.call(nextSource, nextKey)) {
              to[nextKey] = nextSource[nextKey];
            }
          }
        }
      }
      return to;
    },
    writable: true,
    configurable: true,
  });
}

/**
 * 将全局变量内容，整合到 window.gon 中。安全起见，不在页面上显式通过 `window.gon` 的方式进行挂载。
 * ```
 * <script th:inline="javascript" type="application/json" gl>[[${gon}]]</script>
 * ```
 * 1. 依赖自定义的 `InjectExternalChunkPlugin` 形成一个基于 webpack 编译上下文的 assets chunk `gl.js`。
 * 2. 依赖自定义的 `InjectExternalAssetsHtmlPlugin` 最终将 `gl.js` 插入到 html 页面中。
 *
 * @see build/pages.js
 * @see config/webpack.base.config.js
 * @see public/index.html
 */
(function () {
  var gl = document.querySelector('script[gl]');
  window.gon = Object.assign(window.gon || {}, JSON.parse((gl && gl.innerHTML) || '""') || {});
})();
 
